 "Press ALT-F10 for toolbar. Press ALT-0 for help": "Presiones ALT-F10 para la barra de herramientas. Presione ALT-0 para ayuda.", 
 "<p>The reading activity, as the name \nsuggests, should ask the learner to perform some form of activity. This activity \nshould be directly related to the text the learner has been asked to read. \nFeedback to the activity where appropriate, can provide the learner with some \nreflective guidance.<\/p>": "<p>La Actividad de lectura, como su nombre sugiere, \npide al estudiante que realice alg\u00fan tipo de actividad. Esta actividad \ndeber\u00eda estar relacionada directamente con el texto que el estudiante haya debido leer. \nComentarios sobre la actividad donde sea apropiado, pueden proveer al estudiante alguna\nreflexi\u00f3n guiada.<\/p>", 
